import React, { useEffect, useState } from "react";
import { MapContainer, TileLayer, Marker, Popup } from "react-leaflet";
import "leaflet/dist/leaflet.css";
import Papa from "papaparse";

const CENTER = { lat: 14.1467, lng: 121.4708 };

export default function Home() {
  const [spots, setSpots] = useState([]);
  const [route, setRoute] = useState([]);
  const [weather, setWeather] = useState({ weather: [{ main: "Clear" }] });
  const [userPreferences, setUserPreferences] = useState({
    preferNature: true,
    preferCulture: false,
  });

  // Fetch and parse CSV
  useEffect(() => {
    fetch("/data/spots.csv")
      .then((res) => res.text())
      .then((csv) => {
        Papa.parse(csv, {
          header: true,
          skipEmptyLines: true,
          complete: (results) => {
            const rows = results.data
              .filter((r) => r.name && r.lat && r.lng)
              .map((r) => ({
                name: r.name.trim(),
                lat: parseFloat(r.lat),
                lng: parseFloat(r.lng),
                visitors: r.visitors?.trim() || "Moderate",
                image: r.image || null,
                description: r.description || "No description",
                type: r.tags || "nature",
              }));
            setSpots(rows);
          },
        });
      })
      .catch((err) => console.error("Error loading CSV:", err));
  }, []);

  const generateRoute = async () => {
    console.log("Generate Route Clicked!");

    if (!spots.length) {
      alert("Select at least one spot!");
      return;
    }

    try {
      // Prepare data to send
      const payload = {
        spots: spots.map((s) => ({
          name: s.name,
          type: s.type,
          visitors: s.visitors
        })),
        userPreferences
      };

      // Call ML server
      const response = await fetch("http://localhost:5000/predict", {
        method: "POST",
        headers: {
          "Content-Type": "application/json"
        },
        body: JSON.stringify(payload)
      });

      if (!response.ok) throw new Error("ML server not reachable");

      const data = await response.json();
      console.log("ML Route:", data);

      // Set the generated route
      setRoute(data.route);

    } catch (err) {
      console.error(err);
      alert("ML server not reachable. Using default scoring.");

      // fallback: use your dummy scoring
      let scoredSpots = spots.map((spot) => {
        let score = 0;
        if (userPreferences.preferNature && spot.type.includes("nature")) score += 0.3;
        if (userPreferences.preferCulture && spot.type.includes("history")) score += 0.2;
        const visitorRanking = { "Very High": 3, High: 2, Moderate: 1, Low: 0 };
        score += visitorRanking[spot.visitors] || 1;
        return { ...spot, score };
      });
      scoredSpots.sort((a, b) => b.score - a.score);
      setRoute(scoredSpots);
    }
  };

  return (
    <div style={{ display: "grid", gap: 16, gridTemplateColumns: "1fr 1fr" }}>
      <div className="card">
        <h2>Majayjay Overview</h2>
        <div className="map-wrap" style={{ height: "500px" }}>
          {spots.length > 0 ? (
            <MapContainer center={CENTER} zoom={13} style={{ height: "100%", width: "100%" }}>
              <TileLayer
                attribution='&copy; <a href="https://www.openstreetmap.org/">OSM contributors</a>'
                url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
              />
              {(route.length > 0 ? route : spots).map((s, i) => (
                <Marker key={i} position={[s.lat, s.lng]}>
                  <Popup>
                    <strong>{s.name}</strong><br />
                    Visitors: {s.visitors}
                    {s.image && <><br /><img src={s.image} alt={s.name} style={{ width: "150px", borderRadius: "8px", marginTop: "4px" }} /></>}
                    <p>{s.description}</p>
                  </Popup>
                </Marker>
              ))}
            </MapContainer>
          ) : (
            <div>No spots available to display</div>
          )}
        </div>
      </div>

      <div className="card">
        <h2>Most Visited Places</h2>
        <ul style={{ margin: 0, paddingLeft: 18 }}>
          {(route.length > 0 ? route : spots).map((s, i) => (
            <li key={i}>
              <strong>{s.name}</strong> â€” {s.visitors} visitors
            </li>
          ))}
          {spots.length === 0 && <li>No spots found in CSV</li>}
        </ul>
        <button onClick={generateRoute}>Generate Route</button>
      </div>
    </div>
  );
}
